import React from 'react';
import logo from './logo.svg';
import './App.css';

export default class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
         <div>
            <h1>ToDo List</h1>
            <form>
              <input type="text"></input>
              <button>Add</button>
            </form>
            <ul id="list">
              <li></li>
              <li></li>
              <li></li>
            </ul>
         </div>
        </header>
      </div>
    );
  }
}
